// import ResponsiveDrawer from "./roots/Home/Home";

import "./App.css";

function App() {
  return (
    <div className="App">
      {/* <ResponsiveDrawer /> */}
      <Navbar />
      <HeroSection />
      <FeaturedProducts />
      <Footer />
    </div>
  );
}

export default App;
